{
  const cards = {};

  document.querySelectorAll(".recommendation__slider .product-item__card").forEach((elem) => {
    const color = elem.dataset.color;
    if (color) {
      if (cards[color] === undefined) {
        cards[color] = [];
      }
      cards[color].push(elem);
    }
  });
  console.log(cards);
  if (Object.keys(cards).length > 0) {
    window.customEvent.on("product.select", (event) => {
      const product = event.detail;
      if (product.armature_color !== undefined && cards[product.armature_color] !== undefined) {
        Object.entries(cards).forEach(([key, val]) => {
          if (key === product.armature_color) {
            val.forEach((e) =>
              e.parentElement.classList.remove("hidden"));
          } else {
            val.forEach((e) =>
              e.parentElement.classList.add("hidden"));
          }
        });
      }
    });
  }
}
